import React, {useState} from 'react';

const RegisterForm = ({handleRegister }: {handleRegister: (email: string, password: string, firstName: string, lastName: string, phone: string) => void}) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phone, setPhone] = useState('');

    //Agregame un type en e 
    const onSubmit = (e: any) => {
        e.preventDefault();
        handleRegister(email, password, firstName, lastName, phone);
    };

    return (
        <form onSubmit={onSubmit}>
            <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Email" required />
            <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="Password" required />
            <input type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} placeholder="First Name" required />
            <input type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} placeholder="Last Name" required />
            <input type="text" value={phone} onChange={(e) => setPhone(e.target.value)} placeholder="Phone" required />
            <button type="submit">Registrarse</button>
        </form>
    );  
}

export default RegisterForm;
